    async process({ event }) {
        this.logger.info(event);

        this._validateEvent(event);

        const dal = new DAL({
            apiClient: this.apiClient,
            s3Client: this.s3Client,
            logger: this.logger,
            assetId: event.asset_id,
            appKey: event.app_key,
            apiKey: event.api_key,
            appConnectionId: event.app_connection,
            sourceType: event.source_type,
        });

        const cutoffTime = this._getCutoffTime(event.interval);
        const cacheKey = `historical-import/${event.source_type}/asset${event.asset_id}.states`;

        try {
            const cachedState = await this._getCachedState(cacheKey);

            if (event.produce_as) {
                await this._processDataset({ event, dal, cacheKey, cachedState, cutoffTime });
            } else {
                await this._processFiles({ event, dal, cacheKey, cachedState, cutoffTime });
            }
        } catch (err) {
            // Function was cancelled, continue on next invoke
            if (this.cancelled) {
                this.logger.debug(err.message);
            } else {
                throw err;
            }
        }
    }

    async _processFiles({ event, dal, cacheKey, cachedState, cutoffTime }) {
        this.logger.debug('Processing files');

        const files = this._parseFilesFromEvent(event).sort((a, b) => a.stage - b.stage);

        const columnMapping = event.source_type === 'frac' ? await dal.loadColumnMapping() : {};

        const stateFiles = new StateFiles({
            config: appConfig,
            logger: this.logger,
            cacheClient: this.cacheClient,
            cacheKey,
            cachedState,
            files,
            forceStartFrom: event.force_start_from,
        });

        for (const file of stateFiles.filesToProcess()) {
            const importStartTimestamp = stateFiles.getImportStart(file);
            const importEndTimestamp = event.force_end_on || +Infinity;

            const dateTimeResolver = new DateTimeResolver({
                logger: this.logger,
                assetId: event.asset_id,
                columnMapping,
                sourceType: event.source_type,
                timezone: event.timezone,
            });

            const dataParser = csv({
                cast: true,
                skip_empty_lines: true,
                trim: true,
                columns: (columns) => {
                    dateTimeResolver.resolveColumns(columns);
                    return columns.map((col) => col.trim().toLowerCase());
                },
                on_record: (record, { lines }) => {
                    // Skip additional frac header
                    if (event.source_type === 'frac' && lines === 2) {
                        const nonDataMatcher = /^\(.*\)$/i;
                        let nonDataCount = 0;
                        for (const val of Object.values(record)) {
                            if (nonDataCount > 2) {
                                return null;
                            }
                            if (nonDataMatcher.test(val)) {
                                nonDataCount++;
                            }
                        }
                        return record;
                    }

                    const timestamp = dateTimeResolver.getUnixTimeStamp(record);
                    if (timestamp >= importStartTimestamp && timestamp <= importEndTimestamp) {
                        record.read_timestamp = Math.floor(Date.now() / 1000);
                        record.entry_at = timestamp;
                        return record;
                    }
                    return null;
                },
            });

            const dataMapper = new DataMapper({
                provider: event.provider,
                collection: event.collection,
                assetId: event.asset_id,
                companyId: event.company,
                app: appConfig.name,
                stage: file.stage,
            });

            const dataSender = new DataSender({
                dal,
                batchSize: event.data_batch_size ? event.data_batch_size : appConfig.batchSize,
                state: stateFiles,
                fileName: file.name,
                perInvokeSleepMs: event.per_invoke_sleep_ms,
                cutOffTimeCheck: () => {
                    if (new Date().getTime() >= cutoffTime) {
                        this.cancelled = true;
                        throw new Error(`Cutoff time reached`);
                    }
                },
            });

            await utils.pipeline(
                dal.getFileStream({ bucket: file.bucket, fileName: file.name }),
                dataParser,
                dataMapper,
                dataSender
            );

            await dataSender.complete();
        }

        await dal.updateScheduleStatus(event.schedule);
    }

    async _processDataset({ event, dal, cacheKey, cachedState, cutoffTime }) {
        this.logger.debug('Processing dataset');

        const searchParams = {
            provider: event.provider,
            dataset: event.collection,
            query: { asset_id: event.asset_id },
            limit: event.force_end_on - event.force_start_from + 1,
        };

        const datasetStream = await dal.getDatasetStream(searchParams);

        datasetStream.on('data', (data) => {
            console.log(data);
        });

        const state = new StateDataset({
            config: appConfig,
            logger: this.logger,
            cacheClient: this.cacheClient,
            cacheKey,
            cachedState,
        });

        const dataMapper = new DataMapper({
            provider: event.provider,
            collection: event.collection,
            assetId: event.asset_id,
            companyId: event.company,
            produceAs: event.produce_as,
            app: appConfig.name,
        });

        const dataSender = new DataSender({
            dal,
            batchSize: event.data_batch_size ? event.data_batch_size : appConfig.batchSize,
            state,
            fileName: undefined,
            perInvokeSleepMs: event.per_invoke_sleep_ms,
            cutOffTimeCheck: () => {
                if (new Date().getTime() >= cutoffTime) {
                    this.cancelled = true;
                    throw new Error(`Cutoff time reached`);
                }
            },
        });

        await utils.pipeline(datasetStream, dataMapper, dataSender);

        await dataSender.complete();

        await dal.updateScheduleStatus(event.schedule);
    }

    async _getCachedState(cacheKey) {
        try {
            const cachedState = await this.cacheClient.get(cacheKey);

            return JSON.parse(cachedState);
        } catch (err) {
            return {};
        }
    }

    _validateEvent(event) {
        if (!event.asset_id) {
            throw new Error('Asset ID missing from the event');
        }

        if (!event.company) {
            throw new Error('Company missing from the event');
        }
    }

    _parseFilesFromEvent(event) {
        const file = event.historical_file;
        const isFrac = event.source_type === 'frac';

        if (!file) {
            throw new Error('No file information provided');
        }

        if (Array.isArray(file.key_name)) {
            return file.key_name.map((key, index) => ({
                name: key,
                bucket: file.bucket[index],
                stage: isFrac ? Number(file.stage_number[index]) : undefined,
            }));
        }

        return [
            {
                name: file.key_name,
                bucket: file.bucket,
                stage: isFrac ? Number(file.stage_number) : undefined,
            },
        ];
    }

    _getCutoffTime(interval) {
        return moment().add(interval, 'seconds').subtract(100, 'milliseconds').valueOf();
    }
}

module.exports = Processor;

#include <assert.h>
#include <bits/stdc++.h>
using namespace std;
#ifndef __DEBUG__
#define dbg(...) 42
#endif
template <class T> using mpq = priority_queue<T, vector<T>, greater<T>>;

using ll = long long;
using pii = pair<int, int>;
using pll = pair<ll, ll>;
using vl = vector<ll>;
using vi = vector<int>;

constexpr int mod = 998244353;

int main(int argc, char **argv)
{
    int n, m;
    cin >> n >> m;
    vector<string> vs(n);
    for (auto &s : vs)
        cin >> s;

    ll ans = 0;
    auto get_first_row = [&](int col) {
        for (int i = 0; i < n; ++i)
            if (vs[i][col] == '#')
                return i;
        return n;
    };
    vector<int> fbs(m, n);
    for (int i = 0; i < m; ++i)
        fbs[i] = get_first_row(i);

    vector<ll> dp(n + 2, 0);
    for (int i = fbs[0]; i >= 0; --i)
        dp[i] = dp[i + 1] + 1;
    for (int i = 1; i < m; ++i) {
        vector<ll> ndp(n + 2, 0);
        for (int j = fbs[i]; j >= 0; --j)
            ndp[j] = (ndp[j + 1] + (j >= 1 ? dp[j - 1] : dp[0])) % mod;
        dp.swap(ndp);
    }
    cout << dp[0] << endl;
    return 0;
};

