import java.util.Comparator;
import java.util.Map;
import java.util.Scanner;
import java.util.TreeMap;

public class Ex03HeroesOfCodeAndLogicVII {
    public static void main(String[] args) {

        Scanner scanner = new Scanner(System.in);

        int n = Integer.parseInt(scanner.nextLine());

        Map<String, Integer[]> map = new TreeMap<>();

        for (int i = 0; i < n; i++) {
            String player = scanner.nextLine();
            String[] heroArr = player.split(" ");
            String playerName = heroArr[0];
            int hitPoints = Integer.parseInt(heroArr[1]);
            int manaPoints = Integer.parseInt(heroArr[2]);

            map.putIfAbsent(playerName, new Integer[2]);
            map.get(playerName)[0] = hitPoints;
            map.get(playerName)[1] = manaPoints;
        }

        String inputLine = scanner.nextLine();

        while (!inputLine.equals("End")) {
            String[] commandArr = inputLine.split("\\s+-\\s+");
            String command = commandArr[0];
            String heroName = commandArr[1];

            switch (command) {
                case "CastSpell":
                    int neededMP = Integer.parseInt(commandArr[2]);
                    String spellName = commandArr[3];
                    int currentMP = map.get(heroName)[1];

                    if (currentMP >= neededMP) {
                        currentMP -= neededMP;
                        map.get(heroName)[1] = currentMP;
                        System.out.printf("%s has successfully cast %s and now has %d MP!%n", heroName, spellName, currentMP);
                    } else {
                        System.out.printf("%s does not have enough MP to cast %s!%n", heroName, spellName);
                    }

                    break;

                case "TakeDamage":
                    int damage = Integer.parseInt(commandArr[2]);
                    String invader = commandArr[3];
                    int currentDamage = map.get(heroName)[0];
                    currentDamage -= damage;
                    map.get(heroName)[0] = currentDamage;

                    if (map.get(heroName)[0] > 0) {
                        System.out.printf("%s was hit for %d HP by %s and now has %d HP left!%n",
                                heroName, damage, invader, currentDamage);
                    } else {
                        System.out.printf("%s has been killed by %s!%n", heroName, invader);
                        map.remove(heroName);
                    }

                    break;

                case "Recharge":
                    int rechargeAmount = Integer.parseInt(commandArr[2]);
                    int amount = map.get(heroName)[1];

                    if (amount + rechargeAmount > 200) {
                        amount = 200 - amount;
                        System.out.printf("%s recharged for %d MP!%n", heroName, amount);
                        map.get(heroName)[1] = 200;
                    } else {
                        System.out.printf("%s recharged for %d MP!%n", heroName, rechargeAmount);
                        amount += rechargeAmount;
                        map.get(heroName)[1] = amount;
                    }

                    break;

                case "Heal":
                    int amountHeal = Integer.parseInt(commandArr[2]);
                    int currentHeal = map.get(heroName)[0];

                    if (currentHeal + amountHeal > 100) {
                        currentHeal = 100 - currentHeal;
                        System.out.printf("%s healed for %d HP!%n", heroName, currentHeal);
                        map.get(heroName)[0] = 100;
                    } else {
                        System.out.printf("%s healed for %d HP!%n", heroName, amountHeal);
                        currentHeal += amountHeal;
                        map.get(heroName)[0] = currentHeal;
                    }
                    break;
            }
            inputLine = scanner.nextLine();
        }

        map.entrySet().stream()
                .sorted(Comparator.comparingInt(a -> a.getValue()[0]))
                .forEach(entry -> System.out.printf("%s%n  HP: %d%n  MP: %d%n", entry.getKey(), entry.getValue()[0], entry.getValue()[1]));
    }
}

